import React from 'react';

const Home = () => {
  return (
    <div class="home">
        <div class="container">
            <div class="home-iformation">
                <h2 class="home-title">Lorem ipsum</h2>
                <h4 class="home-info">Lorem ipsum dolor sit amet consectetur</h4>
                <p class="home-desc">Lorem ipsum dolor sit amet consectetur 
                    adipisicing elit. Rem impedit <span> commodi officia maiores </span> 
                    fuga accusantium!Rem impedit commodi officia maiores 
                    fuga accusantium!</p>
                <button class="home-btn">Get Started</button>
            </div>
        </div>
    </div>
  );
}

export default Home;
